import './Home.css';
import CardData from './CardData'

const Services = () => {
  return (
      <>
        <div className="brand_section mt-5">
        <div className="container">
            <div className="row">
            {CardData.map((val) =>{
                return(
                    <h1 key={va.id}>{val.Title}</h1>
                )
            })}
            </div>
        </div>
        </div>
        
      </>
  )
};
// const numbers = [1, 2, 3, 4, 5];
// const listItems = numbers.map((number) =>
//   <li>{number}</li>
export default Services;
